function fitTextJs() {
	let coefficientFontSize = 7.1111;
	const ratio = 1280 / 700;
	const $body = document.body;
	const widthBody = document.documentElement.clientWidth;
	const heightBody = document.documentElement.clientHeight;
	const ratioBody = widthBody / heightBody;
	let body_sizes_data = typeof localStorage.body_sizes !== "undefined" ? JSON.parse(localStorage.body_sizes) : {};
	if (ratioBody > ratio) {
		$body.classList.add("body-sm");
		coefficientFontSize = ratioBody / ratio * coefficientFontSize * 1.003
	} else if (ratioBody < ratio) {
		$body.classList.remove("body-sm")
	}
	let setFontSize = fitText($body, coefficientFontSize);
	body_sizes_data.fontSize = setFontSize;
	delete body_sizes_data.bodyHeight;
	delete body_sizes_data.contentWidth;
	delete body_sizes_data.contentHeight;
	localStorage.body_sizes = JSON.stringify(body_sizes_data)
}

function setCss(tablet) {
	const heightBody = document.documentElement.clientHeight;
	const body = document.querySelector("body");
	const style = getComputedStyle(body);
	const fontSize = Number(style.fontSize.slice(0, -2));
	const bodyHeight = heightBody / fontSize + "em";
	const contentWidth = heightBody / fontSize * 1.7 + "em";
	const contentHeight = heightBody / fontSize - 4.345 + "em";
	let header_navigation = document.querySelector(".header-navigation-wrapper");
	let body_sizes_data = typeof localStorage.body_sizes !== "undefined" ? JSON.parse(localStorage.body_sizes) : {};
	body.style.minHeight = bodyHeight;
	body.style.height = bodyHeight;
	body_sizes_data.bodyHeight = bodyHeight;
	if (tablet) {
		jQuery(header_navigation).find(".header-navigation-column .primary-menu li .sub-menu").css("padding-bottom", "13em")
	} else if (window.fullScreen || window.innerWidth === screen.width && window.innerHeight === screen.height) {
		jQuery(header_navigation).find(".header-navigation-column .primary-menu li .sub-menu").css("padding-bottom", "11em")
	} else {
		jQuery(header_navigation).find(".header-navigation-column .primary-menu li .sub-menu").css("padding-bottom", "18em")
	}
	if (tablet) {
		if (header_navigation !== null) {
			header_navigation.style.minHeight = bodyHeight;
			header_navigation.style.height = bodyHeight
		}
	} else {
		jQuery("body .container").css("width", contentWidth);
		jQuery(".site-content.not-footer").css("height", contentHeight);
		body_sizes_data.contentWidth = contentWidth;
		body_sizes_data.contentHeight = contentHeight;
		if (header_navigation !== null) {
			header_navigation.style.minHeight = bodyHeight;
			header_navigation.style.height = bodyHeight
		}
	}
	localStorage.body_sizes = JSON.stringify(body_sizes_data)
}

function getScreenOrientation() {
	return window.innerWidth > window.innerHeight ? "landscape" : "portrait"
}

function wrapInIframe() {
	let is_in_iframe = window.top !== window.self;
	if (!is_in_iframe) {
		let iframe = document.createElement("iframe");
		iframe.src = document.URL;
		iframe.style.width = "100%";
		iframe.style.height = "100vh";
		iframe.style.border = "0";
		iframe.style.background = "#fff";
		let bodyElnts = document.body.querySelectorAll("*");
		bodyElnts.forEach(function (el) {
			el.remove()
		});
		document.body.appendChild(iframe)
	}
}

function unwrapFromIframe() {}

function toggleFullScreen() {
	let is_in_iframe = window.top !== window.self;
	if (!is_in_iframe) {
		if (document.fullscreenElement) {
			document.exitFullscreen();
			screen.orientation.unlock()
		} else {
			document.documentElement.requestFullscreen();
			screen.orientation.lock("landscape");
			wrapInIframe()
		}
	} else {
		if (parent.document.fullscreenElement) {
			parent.document.exitFullscreen();
			screen.orientation.unlock()
		} else {
			parent.document.documentElement.requestFullscreen();
			screen.orientation.lock("landscape")
		}
	}
	window.scrollTo(0, 0);
	fitTextJs()
}

