function imgUrlPrepIos(img, attr) {
	let img_attr_src = img.getAttribute(attr);
	if (img_attr_src !== null) {
		if (img_attr_src.includes("uploads-webpc") && document.body.className.includes("os-osx")) {
			img_attr_src = img_attr_src.replace(/uploads-webpc\//g, "").replace(/.webp/g, "")
		}
	} else {
		img_attr_src = false
	}
	return img_attr_src
}

function iosRemoveWebp() {
	if (document.body.className.includes("os-osx")) {
		document.querySelectorAll("img").forEach(function (img) {
			let img_src = imgUrlPrepIos(img, "src");
			if (img_src) img.setAttribute("src", img_src);
			let img_srcset = imgUrlPrepIos(img, "srcset");
			if (img_srcset) img.setAttribute("srcset", img_srcset);
			let img_data_src = imgUrlPrepIos(img, "data-src");
			if (img_data_src) img.setAttribute("data-src", img_data_src);
			let img_data_srcset = imgUrlPrepIos(img, "data-srcset");
			if (img_data_srcset) img.setAttribute("data-srcset", img_data_srcset);
			let img_data_lazy = imgUrlPrepIos(img, "data-lazy");
			if (img_data_lazy) img.setAttribute("data-lazy", img_data_lazy);
			let img_data_lazy_set = imgUrlPrepIos(img, "data-lazy-set");
			if (img_data_lazy_set) img.setAttribute("data-lazy-set", img_data_lazy_set)
		})
	}
}

function reserveSrcSet() {
	document.querySelectorAll("img").forEach(function (img) {
		let mob_black_screen = document.querySelector(".mobile-black-screen") !== null ? document.querySelector(".mobile-black-screen") : false;
		if (!img.closest("#page_slider") && !img.closest(".nav-slider") && (mob_black_screen && !mob_black_screen.classList.contains("active") || mob_black_screen && mob_black_screen.classList.contains("active") && img.closest(".mobile-black-screen")) && img.getAttribute("data-lazy-set") !== null && img.getAttribute("src") !== null && img.getAttribute("src") === "//:0") {
			let img_src = img.getAttribute("data-lazy-set");
			if (img_src) img.setAttribute("src", img_src);
			img.removeAttribute("data-lazy-set");
			img.removeAttribute("data-lazy")
		}
	})
}

function reserveSrcSetSliders(slick, current_slide_index, next_slide_index = null) {
	next_slide_index !== null ? current_slide_index = next_slide_index : null;
	jQuery(slick.$slides.get(current_slide_index)).find("img").each(function () {
		let img = this;
		if (img.getAttribute("data-lazy-thumbnail") !== null && img.getAttribute("data-lazy-set") !== null && img.getAttribute("src") !== null && img.getAttribute("src") === "//:0") {
			let img_src = img.getAttribute("data-lazy-set");
			if (img_src) img.setAttribute("src", img_src);
			img.removeAttribute("data-lazy-set");
			img.removeAttribute("data-lazy")
		}
	})
}
