	function animateNumbers(parentClass = "") {
		$(parentClass + ".content-wrapper b").each(wrapNumbers);
		$(parentClass + ".count").each(wrapNumbers);
		$(parentClass + ".countIn").each(function () {
			$(this).css("display", "inline-block");
			$(this).css("width", "calc(" + $(this).width() + "px + 0.1em)");
			let cntStr = $(this).text();
			let cntStrArr = cntStr.split(" ");
			let strPart = "",
				newCntStr = "",
				strTail = "";
			if (cntStrArr.length > 1) {
				cntStr = cntStrArr[0];
				cntStrArr.splice(0, 1);
				strPart = " " + cntStrArr.join(" ")
			}
			let delimiter = getDelimiter(cntStr);
			let frac = 3;
			for (var i = 0; i < cntStr.length; i++) {
				var tails = ["%", "+", "$"];
				if (!tails.includes(cntStr[i])) {
					if (cntStr[i] !== "." && cntStr[i] !== "," && cntStr[i] !== "'" && cntStr[i] !== "`") {
						newCntStr += cntStr[i]
					}
				} else {
					strTail += cntStr[i]
				}
				if (cntStr.split(",").length === 2 && cntStr[i] === ",") {
					frac = cntStr.split(",")[1].length
				}
				if (cntStr.split(".").length === 2 && cntStr[i] === ".") {
					frac = cntStr.split(".")[1].length
				}
			}
			cntStr = newCntStr;
			if ($(this).text() !== "000") {
				$(this).prop("Counter", 0).animate({
					Counter: cntStr
				}, {
					duration: 1e3,
					easing: "swing",
					step: function (now) {
						$(this).text(numberDelimiter(Math.ceil(now), delimiter, frac) + strTail + strPart)
					}
				})
			}
		})
	}

	function numberDelimiter(num, delimiter, frac = 3) {
		if (frac === 1) {
			if (num.toString().length > 1) {
				let pos = num.toString().length - frac;
				return num.toString().slice(0, pos) + delimiter + num.toString().slice(-frac)
			} else {
				return num.toString().replace(/\B(?=(\d{1})+(?!\d))/g, delimiter)
			}
		} else if (frac === 2) {
			if (num.toString().length > 2) {
				let pos = num.toString().length - frac;
				return num.toString().slice(0, pos) + delimiter + num.toString().slice(-frac)
			} else {
				return num.toString().replace(/\B(?=(\d{2})+(?!\d))/g, delimiter)
			}
		} else {
			return num.toString().replace(/\B(?=(\d{3})+(?!\d))/g, delimiter)
		}
	}

	function getDelimiter(str) {
		var delimiter = "";
		if (str.indexOf(".") !== -1) return delimiter = ".";
		if (str.indexOf(",") !== -1) return delimiter = ",";
		if (str.indexOf("'") !== -1) return delimiter = "'";
		if (str.indexOf("`") !== -1) return delimiter = "`";
		return delimiter
	}

	function wrapNumbers(i, el) {
		var replacement = '<sb class="countIn">$1</sb>';
		var tempStr = $(el).text();
		var delimiter = getDelimiter(tempStr);
		var regex = /([0-9]+[.,'`][0-9]+|[0-9]+)/g;
		if (tempStr.split(delimiter).length - 1 > 1) {
			regex = /([0-9]+[.,'`]+[0-9]+[.,'`]+[0-9]+|[0-9]+)/g
		}
		if (el.nodeType === 3) {
			if (regex.test(el.data)) {
				$(el).replaceWith(el.data.replace(regex, replacement))
			}
		} else {
			$(el).contents().each(wrapNumbers)
		}
	}

