	function intetics_trim_string_by_line(str, line_length, line_count) {
		line_length = Number(line_length);
		line_count = Number(line_count);
		var word_parts = str.split(" ");
		var line = "",
			line_out = "",
			reserve_word = "";
		var lines = [];
		var i = 1;
		word_parts.forEach(word => {
			if (line.length + word.length + 1 <= line_length) {
				if (i === 1) {
					line += word
				} else {
					line += " " + word
				}
			} else {
				if (reserve_word !== "") {
					lines.push(reserve_word + line);
					reserve_word = ""
				} else {
					lines.push(line)
				}
				reserve_word = word;
				line = ""
			}
			if (i === word_parts.length) {
				lines.push(reserve_word + line)
			}
			i++
		});
		lines.forEach((line, ind) => {
			if (ind === line_count - 1 && lines.length > line_count) {
				line = line + '<span class="dots-more"></span><span style="display:none">'
			}
			if (ind !== 0) {
				line_out += " " + line
			} else {
				line_out += line
			}
		});
		return line_out + "</span>"
	}

