	function swipeMobile() {
		document.addEventListener("touchstart", handleTouchStart, false);
		document.addEventListener("touchmove", handleTouchMove, false);
		var xDown = null;
		var yDown = null;

		function getTouches(evt) {
			return evt.touches || evt.originalEvent.touches
		}

		function handleTouchStart(evt) {
			const firstTouch = getTouches(evt)[0];
			xDown = firstTouch.clientX;
			yDown = firstTouch.clientY
		}

		function handleTouchMove(evt) {
			if (!xDown || !yDown) {
				return
			}
			var xUp = evt.touches[0].clientX;
			var yUp = evt.touches[0].clientY;
			var xDiff = xDown - xUp;
			var yDiff = yDown - yUp;
			let fs_off_menu = document.querySelector(".fullscreen-off-menu");
			if (Math.abs(xDiff) > Math.abs(yDiff)) {
				if (xDiff > 8) {
					navigateOnSwipe(true)
				} else if (xDiff < -8) {
					navigateOnSwipe(false)
				}
			} else {
				if (yDiff > 0) {
					fs_off_menu.classList.remove("open");
					fs_off_menu.style.display = "none"
				} else {
					if ((document.fullscreenElement || parent.document.fullscreenElement) && !window.touchInScrollArea) {
						fs_off_menu.classList.add("open");
						fs_off_menu.style.display = "flex"
					}
				}
			}
			xDown = null;
			yDown = null
		}
	}

